import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const state = {
  postsData: [
    { name: 'Anton', message: 'HI, im new', likes: 10, dislikes: 1 },
    { name: 'Andrew', message: 'I learn REact', likes: 130, dislikes: 1 },
    { name: 'Jack', message: 'Yo', likes: 120, dislikes: 3 },
    { name: 'John', message: 'HELLO', likes: 13, dislikes: 4 },
    { name: 'kai', message: 'I like programming', likes: 410, dislikes: 2 }
  ],
  dialogsData: [
    {id: '1', name: 'Anton'},
    {id: '2', name: 'Andrey'},
    {id: '3', name: 'Anya'},
    {id: '4', name: 'Alena'},
    {id: '5', name: 'Anastasia'}
  ],
  messagesData: [
    {id: '1', message: 'Hello'},
    {id: '2', message: 'Sup Bro'},
    {id: '3', message: 'Hey hey hey'},
    {id: '4', message: 'React is nice'}
  ]
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App postsData={state.postsData} dialogsData={statedialogsData} messagesData={state.messagesData} />
  </React.StrictMode>
);

